C.a.h(u,new R.bW("Lampe Imande","Imande ist S\xfcdafrikanisch und bedeutet Wurzel. Eine Lampe aus Fichtenholz, deren Wurzeln ein beeindruckendes Konstrukt bilden, sorgt f\xfcr ausgezeichnete Balance zwischen Funktionalit\xe4t und Design. Hierf\xfcr wird zwar etwas mehr Platz ben\xf6tigt, dennoch passt sie sich jedem Umfeld elegant an.","images/Imande.jpg"))
C.a.h(u,new R.bW("Lampe Ibaleke","Ibaleke ist Zulu und bedeutet gerader Weg. Eine Lampe aus Fichtenholz und einem Standbein aus Grafitstein bilden zusammen ein sehr geradliniges Design, das von Bordeauxfarben abgerundet wird.","images/Ibaleke.jpg"))
C.a.h(u,new R.bW("Halskette Elegansie","Elegansie ist Afrikanisch und steht f\xfcr Eleganz. Eine Halskette aus Fichtenholz, das durch Flammen und Hitze zu einem Unikat geformt wurde. Unz\xe4hlige Schleifarbeiten und 4K Gold sorgen f\xfcr besten Tragekomfort, womit Sie auch endlose Tage \xfcberstehen.","images/Elegansie.jpg"))
C.a.h(u,new R.bW("Wandbild Avikele","Avikele ist Zulu und bedeutet Schild. Eine schwere Konstruktion, die aus 95 Buchenelementen besteht, kreiert eine Form, die einem Schild nahekommt. In Verbindung mit einer indirekten Beleuchtung schafft sie es, durch hohe Pr\xe4sens direkt herauszustechen und klaut jedem Gem\xe4lde die Show.","images/Avikele.jpg"))
C.a.h(u,new R.bW("Flaschenhalterung Antiguo","Antiguo ist Spanisch und bedeutet alt. Eine Flaschenhalterung aus Eichenholz, das mehr als ein halbes Jahrhundert jeder Witterung trotzte. Eine faszinierende Oberfl\xe4che, die Geschichten erz\xe4hlt, l\xe4sst jedes Weinfass alt aussehen. Die verwitterte Rinde bildet dazu den perfekten Kontrast und l\xe4dt zu einem Drink ein.","images/Antiguo.jpg"))
C.a.h(u,new R.bW("Glasuntersetzer Aniani","Aniani ist Hawaiisch und bedeutet Glas. Das Fundament bildet hier eine Fichte, die im Arrangement mit Kristallgl\xe4sern die Spuren der Natur noch besser zur Geltung bringt. \xdcberzeugt durch Vielfalt!","images/Aniani.jpg"))
C.a.h(u,new R.bW("Lampe Volamena","Volamena ist Madagassisch und bedeutet Gold. Eine Lampe aus Erlenholz deren Form einer Muschel nahe kommt wird von einem Lampenschirm mit Goldeinlage indirekt reflektiert. Ein Schieferstein mit Pyritgoldeinlagen sorgt f\xfcr eine erstklassige Abrundung des Gesamtbildes.","images/Volamena.jpg"))
